code = [
    '',
    '',
    '',
    '',
    '',
]

PART_ONE = {
    (0, 0): 1,
    (0, 1): 2,
    (0, 2): 3,
    (1, 0): 4,
    (1, 1): 5,
    (1, 2): 6,
    (2, 0): 7,
    (2, 1): 8,
    (2, 2): 9,
}
PART_TWO  = {
    (0, 2): 1,

    (1, 1): 2,
    (1, 2): 3,
    (1, 3): 4,

    (2, 0): 5,
    (2, 1): 6,
    (2, 2): 7,
    (2, 3): 8,
    (2, 4): 9,

    (3, 1): 'A',
    (3, 2): 'B',
    (3, 3): 'C',

    (4, 2): 'D',
}

nums = PART_TWO

def move(curr_loc, down, right):
    new_loc = (curr_loc[0] + down, curr_loc[1] + right)
    return new_loc if new_loc in nums else curr_loc

curr_loc = (1, 1)
for instruction_set in code:
    for movement in instruction_set:
        if movement == 'U':
            curr_loc = move(curr_loc, -1, 0)
        elif movement == 'D':
            curr_loc = move(curr_loc, 1, 0)
        elif movement == 'L':
            curr_loc = move(curr_loc, 0, -1)
        elif movement == 'R':
            curr_loc = move(curr_loc, 0, 1)
    print(nums[curr_loc])
